import React from 'react';
import "./Login.css"

export default function Login() {
    return (
        <div className="container">
            <div className="signin">
                <div className="signinWrapper">
                    <img className="singinHeader" src="./LoginImg/tixlogo.png" />
                </div>
            </div>
        </div>
    )
}
